import React, { Component } from 'react'
export default class Frank extends Component {
    render(){
        return(
            <div>
                <h1>Franz Kafka was a German-speaking Bohemian novelist and short-story writer, widely regarded as one of the major figures of 20th-century literature.</h1>
            </div>
        )
    }
}
